import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import Grid from '@material-ui/core/Grid';


class ColorPaletteList extends Component {

    render() {
        return(
            <Grid container spacing={5} className="ColorPaletteList">
                {this.props.colorPalettes.map(palette => (
                    <Grid item xs={12} sm={3} style={{border: "1px solid gray"}}>
                        {
                            palette.colors.map(color =>(
                                <div style={{backgroundColor: color.color, height:"15%", width: "20%", display: "inline-block", margin: "0"}}>
                                    {/* {color.name} */}
                                </div>
                            ))
                        } 
                        <Link to = {`/palettes/${palette.id}`}>{palette.paletteName}</Link>                  
                    </Grid> 
                    
                ))}
            </Grid>
        )
    }
}

export default ColorPaletteList;
